   pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1915260","type":"CustomJS"},{"attributes":{},"id":"1914938","type":"ResetTool"},{"attributes":{},"id":"1915118","type":"LinearScale"},{"attributes":{"data":{},"selected":{"id":"1915008"},"selection_policy":{"id":"1915007"}},"id":"1914988","type":"ColumnDataSource"},{"attributes":{},"id":"1914977","type":"BasicTickFormatter"},{"attributes":{"source":{"id":"1914909"}},"id":"1915242","type":"CDSView"},{"attributes":{},"id":"1915298","type":"BasicTickFormatter"},{"attributes":{},"id":"1914896","type":"UndoTool"},{"attributes":{"coordinates":null,"data_source":{"id":"1914909"},"glyph":{"id":"1915172"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1915174"},"nonselection_glyph":{"id":"1915173"},"view":{"id":"1915176"}},"id":"1915175","type":"GlyphRenderer"},{"attributes":{},"id":"1914939","type":"SaveTool"},{"attributes":{"toolbar":{"id":"1915346"}},"id":"1915347","type":"ToolbarBox"},{"attributes":{"fill_color":{"field"
